import './App.css';

function App() {
  return (
    <div className="App-header">
       <font size ="10"><p1>devjinx</p1></font>
       <font size ="5"><p2>Chareonlertkamol Thanakorns</p2></font>
       <font size="5"><p3>Student Software Develope Freelance-Dev</p3></font>
       <h1> </h1>
       <button><a href="https://github.com/devjinx">Github</a></button>
       <button1><a href="https://linktr.ee/devjinx">linktree</a></button1>
       <button2><a href="https://drive.google.com/file/d/1Nfqo4ZCqsBigaZC-Hk9hS0pH3slsE4y0/view?usp=sharing">resume</a></button2>
       <button3><a href="https://drive.google.com/drive/folders/1FAz-gHeHm1-oaJ5SFE03KWY_vQO7YOkD?usp=sharing">Certificate</a></button3>
       <button4><a href="https://twitter.com/devjinx_">Twitter</a></button4>
       <button4><a href="mailto: jeongseokjin28@gmail.com">Send Email</a></button4>
       <button4><a href="https://twitter.com/devjinx_">Calling</a></button4>
    </div>
  );
}

export default App;
